import React from 'react';
import './index.scss';
import Project from './Projectcard.js';


const projectCard = [
    {
        title: 'E-Cart Management',
        date: 'March 2023 - April 2023',
        tools: 'Backend Development: C#, Database Management: SQL',
        description: 'Designed and created API for an E-cart system with features such as product display,cart management,'+
        'order modification. Designed a SQL database for the E-Cart Management system.',
        imageUrl: '../../assets/images/e-commerce.png'
    },
    {
        title: 'Employee Management System(CRUD Operations) In MVC',
        date: 'September 2022 - December 2022',
        tools: 'ASP.NET MVC,C#,SQL',
        description: 'Implemented a comprehensive Employee Management System using the Model-View-Controller (MVC)'+
        'architectural pattern in C#. Integrated a SQL database to store and retrieve employee details.',
        imageUrl: '../../assets/images/employee-manage.png'
    },
    {
        title: 'Earthquake Prediction Using Machine Learning',
        date: 'January 2023 - April 2023',
        tools: 'Machine Learning Framework: CatBoost;Flask',
        description: 'Developed a web application that predicts earthquake risk based on location using the'+
        'machine learning model CatBoost algorithm.Integrated the Twilio API to enable automated SMS notifications of '+
        'earthquake predictions.',
        imageUrl: '../../assets/images/Earthquake.png'
    },
    {
        title: 'A Deep Learning Approach For Twitter Bot Detection',
        date: 'Mar 2022 - Nov 2022',
        tools: 'Machine Learning Framework: BERT;Flask',
        description: 'Twitter, a social networking platform allows users to convey their ideas. on a wide range of topics,'+
        'including politics, sports, the stock market, and entertainment. It has a big influence on how people think. A bot on Twitter sends spam messages.'+
        'An application that detects bots in twitter using BERT model.',
        imageUrl: '../../assets/images/twitter-bot.png'
    },
    {
        title: 'Blood Bank Management System',
        date: 'Jun 2021 - Jun 2021',
        tools: 'Database: MS SQl, Visual Basic',
        description: 'A blood bank system that can assist the information of amount of blood available and the donor list. Used Visual studio 16.10, community edition as IDE'+
        'Visual basic for frontend Microsoft SQL server, express edition as backend Github for version control',
        imageUrl: '../../assets/images/blood.png'
    }
]
const Projectcard = () =>{
    return(
        <div className='project-card'>
            <h2>PROJECTS</h2>
            <div className='proje-card-cont'>
                {
                    projectCard.map((project,index) => (
                        <Project key={index} project={project} />
                    ))}
            </div>
        </div>
    );
};




export default Projectcard;
